import InputField from "../components/InputField";
import Select from "react-select"

const InvoicesFilter = ({invoice}) => {

    return (
        <>
            <form>
                <label>
                    Dodavatel
                    <Select options={invoice.map((item, index))}>
                        <option value="">Vyberte...</option>
                        {invoice.map((invoice, index) => (
                        <option key={index} value={invoice.seller}>
                        {invoice.seller}
                        </option>
                        ))}
                    </Select>
                </label>


            </form>
        </>
    )
}

export default InvoicesFilter;
